CREATE TABLE Inventory(
   Product_ID      INTEGER  NOT NULL PRIMARY KEY 
  ,Availibility    VARCHAR(255) NOT NULL
  ,Product_Name    VARCHAR(255) NOT NULL
  ,Stock_Available INTEGER  NOT NULL
);









CREATE TABLE Offices(
   Office_ID      VARCHAR(7) NOT NULL PRIMARY KEY
  ,Office_Name    VARCHAR(11) NOT NULL
  ,Office_Address VARCHAR(19) NOT NULL
  ,Office_Email   VARCHAR(23) NOT NULL
  ,Office_Contact VARCHAR(12) NOT NULL
);








CREATE TABLE Shipping(
   Ship_ID            VARCHAR(10) NOT NULL PRIMARY KEY
  ,Ship_Name          VARCHAR(13) NOT NULL
  ,Ship_Crew_Memebers INTEGER  NOT NULL
);




CREATE TABLE Supplier(
   Supplier_ID        INT  NOT NULL PRIMARY KEY 
  ,Supplier_address   VARCHAR(25) NOT NULL
  ,Supplier_contact   VARCHAR(21) NOT NULL
  ,Supplier_Full_Name VARCHAR(20) NOT NULL
);





CREATE TABLE Warehouses(
   Warehouse_ID   VARCHAR(10) NOT NULL PRIMARY KEY
  ,CONTACT        VARCHAR(20) NOT NULL
  ,Warehouse_Name VARCHAR(16) NOT NULL
  ,Address        VARCHAR(22) NOT NULL
);


CREATE TABLE Customer(
   Customer_ID      VARCHAR(255) NOT NULL PRIMARY KEY
  ,Customer_Name    VARCHAR(255) NOT NULL
  ,Customer_Total   INTEGER  NOT NULL
  ,Customer_Contact VARCHAR(255) NOT NULL

  ,Customer_Address VARCHAR(255) NOT NULL
);





CREATE TABLE Employee(
   Employee_ID        VARCHAR(255) NOT NULL PRIMARY KEY
  ,Employee_Name      VARCHAR(255) NOT NULL
  ,Employee_Job_Title VARCHAR(255)
  ,Employee_Salary    INTEGER 
  ,Employee_Gender    VARCHAR(255) NOT NULL
  ,Employee_Address   VARCHAR(255) NOT NULL
);



CREATE TABLE Warehouses(
   Warehouse_ID   VARCHAR(10) NOT NULL PRIMARY KEY
  ,CONTACT        VARCHAR(20) NOT NULL
  ,Warehouse_Name VARCHAR(16) NOT NULL
  ,Address        VARCHAR(22) NOT NULL
);











CREATE TABLE Ship_Employee(
   Ship_ID     VARCHAR(10) NOT NULL 
  , Employee_ID        VARCHAR(255) NOT NULL
  ,Foreign key (Ship_ID) references Shipping(Ship_ID)
  ,Foreign key (Employee_ID) references Employee(Employee_ID)


);





CREATE TABLE Warehouse_Employee(
   Warehouse_ID VARCHAR(10) NOT NULL 
  ,Employee_ID        VARCHAR(255) NOT NULL
  ,Foreign KEY (Warehouse_ID) references Warehouses(Warehouse_ID),
  Foreign KEY (Employee_ID) references Employee(Employee_ID)
);



CREATE TABLE Office_Employee(
   Office_ID   VARCHAR(7) NOT NULL 
  ,Employee_ID VARCHAR(255) NOT NULL,
  Foreign key (Office_ID ) references Offices(Office_ID )
  ,Foreign key (Employee_ID ) references Employee(Employee_ID )

);



CREATE TABLE Customer_Inventory(
   Customer_ID       VARCHAR(255) NOT NULL
  ,Product_ID       INTEGER  NOT NULL
  ,Delievery_Status VARCHAR(14) NOT NULL
  ,Customer_Total   INTEGER  NOT NULL
  ,Customer_Address VARCHAR(27) NOT NULL
  ,FOREIGN KEY (Customer_ID) references Customer(Customer_ID)
  ,FOREIGN KEY (Product_ID) references Inventory(Product_ID)

);



CREATE TABLE Warehouse_Inventory(
   Product_ID     INTEGER  NOT NULL 
  ,Warehouse_ID   VARCHAR(10) NOT NULL
  ,Warehouse_Name VARCHAR(16) NOT NULL
  ,Address        VARCHAR(22) NOT NULL

  FOREIGN KEY (Product_ID ) REFERENCeS Inventory(Product_ID ),
  FOREIGN KEY (Warehouse_ID ) REFERENCeS Warehouses(Warehouse_ID)

);





CREATE TABLE Product_Supplier(
   Product_ID         INTEGER  NOT NULL
  ,Supplier_ID        INTEGER  NOT NULL
  ,Supplier_Full_Name VARCHAR(20) NOT NULL
  ,Supplier_address   VARCHAR(24) NOT NULL
  ,FOREIGN KEY(Product_ID) references Inventory(Product_ID)
  ,FOREIGN KEY(Supplier_ID) references Supplier(Supplier_ID)
);





/*SQL QUERY 1 :

This Query is used to generate the list of employees in database whose salary 
ranges from 25000 to 50000*/

select Employee_Name, Employee_Salary from Employee
where Employee_ID IN


(Select Employee_ID from Employee
where	Employee_Salary between 25000 AND 50000);




