/*SQL QUERY 9: 
The following SQL Query obtained provides us the product ID of repeating values
which we often nee in order to know which product is most selling or which product has more customers*/

select Product_ID ,count(Product_ID) from Customer_Inventory 
group by Product_ID having Count(Product_ID)>1;



/*SQL QUERY 10:
Creates a simple getter procedure to get a list of most repeating */




select Supplier_ID,Product_ID,count(Product_ID) from Product_Supplier 
group by  Supplier_ID,Product_ID  having Count(Supplier_ID)>1;



select*from Product_Supplier;


